('50a5b0b0-6d74-11e8-a018-9f339761b201', 2, 0, 2, '良师益友', 'oodE240FKxLoCIhtcnzbhcn4FskY', '', '初学职场包括加入头马的都哪12个月里面遇到了很多。你真东西，而且能够陪着你我一起体验一起。go啊，鹅鹅。不一定有老师的名字，他也不一定是多么饿知己的。是啊，是不。这样的良师益友，我想我要说我。噢噢，不解释。二文娥。你咧。去就像官员去了解俱乐部的管理，整个这个过程中，我觉得他不但是有。不喝不。都不晚。阿不。是有了，他自己能够把很多事情做到就可以了，给我们很多影响我觉得他。不不。结果这么大的演讲也我自己一直觉得我的记性的结构都很差啊，包括刚刚我讲的很差，但是我听。我的英语老师，你从一堂课，讲到勒，这一个人的教学风格，从这一个教育风格，假的，他让你爱上英语课。爱上学习你的学习就有不一样，看法竟然又从学校到职场。整个生活都不一样，那么这样一位良师益友，从真的从一堂课的这么一个细小的地方就能改变。', 61, 0, 1, 0, 'aa21ab40-6d73-11e8-8bfe-f9e10c892bdd', '2018-06-11 12:39:20'),
