('86f993e0-6caf-11e8-91c2-ef1e67f4bc4c', 1, 0, 2, '不想当将军的士兵', 'oodE24_7jIys881HhvYPIjCBfQXc', '', 'music都说不想当将军的视频不是好士兵之前，我也一直都是这么认为的，因我想。每个人总要有一点目标，总要有一点报复吧，虽然我们小的时候老师经常就会问我们，那你们长大勒。都护理院。很长一段时间会在家人社会的要求下一直去做很多很多，这样的事情确实。我也得到了一些东西，不过，同时我也发现一个问题就是我觉得一些别人希望我得到的。咧咧。开始接触一些其它的生活，比如说我去做了义工，这只是一些小小的事情。我发现在帮助这些孩子的时候，虽然这不是一个特别大的事情却让我觉得发自内心的快乐。可是一直陪着他，后来他居然开始跟我越来越熟了以后居然对着我笑了，我记得看他笑的那一刻。我的心情真的是特别的兴奋，很满足，所以我想我想说不想当将军。', 135, 0, 1, 0, NULL, '2018-06-10 13:09:40'),
