('a2b93860-6d7c-11e8-ae43-517e9b4b0f94', 1, 0, 2, '分享', 'oodE240wf_ABPfldbaNzkrUBBc14', '', '分享。那看到这个让我想到。今天下午呃。姐姐三个小侄子想吃。你回来在路上呢。买了点吃的给他们呐。在过程当中其实发生了。小针织阿可能醉。东西，先做一个分。那为他不太愿意把自己的。想他认为他几点见。那不吃，但是他呆会儿可能。吃那爸爸妈妈可能不能。或者是家人不能帮他做主。决定把这个东西给与出去。那如何在小朋友。还小的时候去帮助他们树立。跟分享的意识跟概念是强。请把我们的知识，这个观念给予他。身上吗，其实我今天有人真的去。男性过这个事情，我们会在想。真想是特别好的一个。习惯吗，他我们。说要做也许大人觉得。在我们那。想法当中分享是很大方也是一。真假的东西，但是如果作为。分享一定要尊重。是的意愿，如果说你这个东西。你到他，那这个东西就是他的。当你要再让他去给别人。想的时候，你也要站在他的立场上。为他考虑，他愿不愿意做这件事。他不愿意做阿，你。一个呵斥你的一个。强行给予的一个洞。做会不会伤害到小朋友能？能帮助他更好地去树立这个。确实值得我们去思考。通过通邮小朋友这件事情让我。分享的初心，德是。自己愿意去做这件事情。等于是帮助大家。我说你不愿意去做。强行强迫你去做这个动作的。我觉得分享对你来说是。一个像是在。不，你东西这么的一个过程。所以，不论是我对小朋友。也好多，承认也好分享是好的东西。但一定是在。你去做这件事情，谢谢。', 134, 1, 8, 0, NULL, '2018-06-11 13:37:56'),
